import { Typography } from '@mui/material'
import React from 'react'

export const Movies = () => {
  return (
    <Box margin={'auto'} marginTop={4}>
        <Typography variant='h4' padding={2} textAlign={'center'}>
            All Movies
        </Typography>
    </Box>
  )        
}
